import React from "react";
import {Link} from "react-router-dom";

const NavBar = () =>{
    return(
        <>
            <Link to="/" >Home</Link>
            <Link to="/register" >Register</Link>
            <Link to="/login" >Login</Link>
            <Link to="/customer" >Customer</Link>
        </>
    );
}
export default NavBar;
